                <p>“来，把这碗药喝下去！”</p><p>看着楚渊递过来的碗，徐若思身子忍不住一抖。</p><p>拉着他的袖子，“王爷，能不能不要喝？”</p><p>“如今咱们还不能有孩子，你想，如果咱们在太子之前有孩子，皇后对觉得我有异心，我如今处境本就尴尬，若思乖，把药喝下去，不会很疼的！”</p><p>徐若思看着那碗越来越近，然后到了她嘴边，熟悉的气息，一如既往的话语，可是来不及拒绝，也舍不得拒绝。</p><p>便让楚渊把去子药喂到了口中。</p><p>咽下满腔的苦涩。</p><p>“若思不怕，我陪着你！”楚渊说道。</p><p>徐若思笑，以为这一次，楚渊会留下来，却不想他又被属下给请走。</p><p>留她一个人在屋子里，身子疼的蜷缩成一团，丫鬟、婆子全部都在屋子外，她不让她们进来，不想让她们看见，她这个母亲，如此狠心。</p><p>一次又一次，把腹中的孩子");
            WriteLiteral(@"杀掉。</p><p>“呜呜……”</p><p>楚渊！徐若思轻轻的呢喃一声。</p><p>再那剧痛袭遍全身，让她想要昏厥，都晕不过去，抬手打碎了一边的花瓶，她看到丫鬟、婆子进来，有条不紊的把她抬到了床上，然后有人揉着她的肚子，把那一团揉出来。</p><p>疼入骨髓。</p><p>楚渊，她是如此的爱他。</p><p>可是，四次了，一次都没有留在她身边，他真的爱她吗？可若是不爱，为什么一次次要她，甜言蜜语张嘴便来，珍宝、绫罗绸缎一如王府就往她的宅院送。</p><p>他是爱她的吧。</p><p>可她终归错了，错的离谱……</p><p>这一次，徐若思身子格外的虚弱，再次走出院门，已经是半年后，这个天下，早已经易主，而这个主人，就是楚渊。</p><p>她知道，为他开心。</p><p>他很快就是皇帝了！</p><p>但……</p><p>“表姐终于舍得出来了！”</p><p>看着对面走来的妇人，徐若思眉头微蹙。</p><p>林珑，她怎么会在王府？</p><p>“姐姐好奇我为什么来了王府吗？因为是王爷接我来的呀，不单单如此，王爷还要接我入宫，封我做皇后呢！”林珑说着，得意又嚣张的笑了起来。</p><p>“你，你……”</p><p>徐若思愤怒的看着林珑。</p><p>“不，不可能，王爷不会这样子对我，不会这样子对我！”</p><p>不会，楚渊不会的。</p><p>林珑冷笑，靠近徐若思，“你真是蠢，王爷当年想娶的本就是我，只是你徐家嫡女，嫁妆又丰厚，他权衡再三，才娶了你，所以你以为他爱你吗？不要做梦了，若真是爱你，为什么不让你生下孩子，一而再、再而三的让你堕去腹中胎儿？因为他说，只有我，只有我才配生下他的孩子，而你徐若思，不配！”</p><p>“不！”</p><p>徐若思怒喝一声，一把推开林珑。</p><p>林珑一下子摔在地上，顿时凄凄哭了出声，“表姐，我只是来看看你，我和王爷是清白的，请你不要这样子说王爷，王爷不是你口中那种爱慕虚荣的人，更没有贪你嫁妆，王爷……”</p><p>徐若思跌跌撞撞后退好几步，听着林珑的胡言乱语，还未来得及反驳，脸上就被狠狠的打了一巴掌。</p><p>“徐若思，你太过分了！”楚渊怒喝出声。</p>
